		function levelLoop(e) {
			if (!levelsuccess && !levelmoving) {
				if (swipeArray.length > 0) {
					if (solutionplay && showdelay > 0) {
						showdelay--;
					} else {
						if (die) {
							swipeArray.shift();
						} else {
							movx=0;movy=0;
							richting = swipeArray.shift();
							if (richting == 1) movx=1;
							else if (richting == 2) movx=-1;
							else if (richting == 3) movy=1;
							else if (richting == 4) movy =-1;
							moveteller = 4;
							levelmoving = true;
							movebepaald = false;
							if (solutionplay) showdelay = showdelayspeed;
						}
					}
				}
			}
			if (!levelsuccess && levelmoving) {
				moveLevel(false);
			}
			if (levelsuccess && !levelsuccessgetoond) {
				if (!solutionplay) {
					sceneScherm.spr_buttonundo.visible = false;
					sceneScherm.spr_buttonretry.visible = false;
					window.removeEventListener("keydown",checkKeys);
					sceneScherm.removeEventListener("mousedown", startSwipe);
					sceneScherm.removeEventListener("pressup", stopSwipe);
					if (sceneScherm.musicon) {
						sceneScherm.mysong.stop();
						sceneScherm.mysong=null;
						sceneScherm.myChannelSongNr = -1;
					}
					if (sceneScherm.musicon) createjs.Sound.play ("snd_success");
					toonsuccess();
					successteller = 0;
					levelsuccessgetoond = true;
				} else {
					window.removeEventListener("keydown",checkKeysSol);
					showdelay++;
					if (showdelay == (showdelayspeed+1)) {
						toonsuccess();
					}
					if (showdelay == 60) {
						solutionplay = false;
						removeStaticObjects();
						swipeArray = null;
						movestate = null;
						moversArray = null;
						workStaticObjectsArray = null;
						workStaticObjectsTypeArray = null;
						sceneScherm.removeChild(recShape);
						createjs.Ticker.removeEventListener("tick",levelLoop);
						initMainGameLevel();
					}
				}
			}  else if (levelsuccess && levelsuccessgetoond) {
				successteller++;
				if (successteller == 45) {
					if (sceneScherm.musicon) createjs.Sound.play ("snd_hey");
				}
				if (successteller == 60) {
					removeStaticObjects();
					sceneScherm.spr_buttonundo.removeEventListener("click",onUndoClickEvent);
					sceneScherm.spr_buttonundo.visible=false;
					sceneScherm.spr_buttonretry.removeEventListener("click",onRetryClickEvent);
					sceneScherm.spr_buttonretry.visible=false;
					sceneScherm.spr_buttonback.removeEventListener("click",onBackClickEvent);
					sceneScherm.spr_buttonback.visible=false;
					sceneScherm.spr_buttonhint.removeEventListener("click",onHintClickEvent);
					sceneScherm.spr_buttonhint.visible=false;
					sceneScherm.spr_leveltekst.visible=false;
					sceneScherm.spr_swipeicon.visible=false;
					swipeArray = null;
					movestate = null;
					moversArray = null;
					workStaticObjectsArray = null;
					workStaticObjectsTypeArray = null;
					sceneScherm.removeChild(recShape);
					sceneScherm.lvl++;
		//			if (lvl == 11) {
		//				trace("COMPLETED10");
		//			} else if (lvl == 26) {
		//				trace("COMPLETED25");
		//			} else if (lvl == 51) {
		//				trace("COMPLETED50");
		//			}
					if (sceneScherm.lvl>sceneScherm.hoogste) {
						sceneScherm.hoogste=sceneScherm.lvl;
						try {localStorage['thelogicalevel']=sceneScherm.lvl} catch(err) {}			
					}
				} else if (successteller>60) {
					createjs.Ticker.removeEventListener("tick",levelLoop);
					if (sceneScherm.lvl > sceneScherm.endlvl) initEndLevel();
					else initMainGameLevel();
				}
			}
		}
